import React from 'react';
import ReactDOM from 'react-dom/client';
import { Navbar, Footer } from "./pages/layout";


function App() {
  return (
    <div>
      <Navbar />
      <h1>Hello</h1>
      <Footer />
    </div>  )

}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
